import React from 'react';

class TableRow extends React.Component {
   render() {
     const {
       data
     } = this.props;
     const row = data.map((data) =>
     <tr>
       <td key={data.name}>{data.name}</td>
       <td key={data.id}>{data.id}</td>
       <td key={data.price}>{data.price}</td>
     </tr>
     );
     return (
       <span>{row}</span>
     );
   }
 }

class TableList extends React.Component {

   render() {
      const { data } = this.props;
      const row = data.map((data) =>
         <tr>
            <td key={data.hospital}>{data.hospital}</td>
            <td key={data._id}>{data.id}</td>
         </tr>
      );
      // const listItems = this.props.datatList.map(
      //    (item) => <li key={item._id}> {item.hospital} </li>
      // );

      return (
         <div>
            <h2>Table List</h2>
            <table>
               <row data={this.props.datatList} />
            </table>
         </div>
      )
   }
}

export default TableList;
